In 1993 worden drie kinderen op beestachtige wijze vermoord. Weken later kondigt de politie aan dat ze drie tieners hebben gearresteerd die de moorden hebben gepleegd als onderdeel van een satanisch ritueel. Tussen de bewijsstukken zitten posters van de rockband Metallica en boeken van Anne Rice en Stephen King. Gebaseerd op het waargebeurde verhaal van een beruchte moordzaak in Arkansas.


